set.middleware.eiq:
  section-type: set
  belong_to: set.middleware.eiq
  section_info:
    fixed_id: nxp_eiq_machine_learning
    full_name: eIQ
    version: '1.3'
    description: 'eIQ machine learning SDK containing: - ARM CMSIS-NN library (neural
      network kernels optimized  for Cortex-M cores) - an inference engine for running
      TensorFlow Lite models - project examples for the Glow NN Compiler'
    display_name: eIQ
    set_location:
      repo_base_path: middleware/eiq
    type: middleware
    vendor: NXP
    product:
      kex_package:
        kex_web_ui:
          ui_control: true
          ui_release_specific: true
          ui_control_default: false
          ui_category: Middleware
        scr:
        - scr.middleware.eiq_tensorflow_lite
        - scr.middleware.eiq_FFT2D
        - scr.middleware.eiq_FlatBuffers
        - scr.middleware.eiq_gemmlowp
        - scr.middleware.eiq_KissFFT
        - scr.middleware.eiq_ruy
        - scr.middleware.eiq_tensorflow_lite_micro_cmsis_nn
        - scr.middleware.eiq_tensorflow_lite_micro_xtensa_nn
        - scr.middleware.Glow_Utils
        - scr.middleware.DeepviewRT_Library
        - scr.middleware.DeepviewRT_Sample
        - scr.middleware.mpp
      cmsis_pack:
        vendor: NXP
        supported: false
        scr:
        - scr.middleware.eiq_tensorflow_lite
        - scr.middleware.eiq_FFT2D
        - scr.middleware.eiq_FlatBuffers
        - scr.middleware.eiq_gemmlowp
        - scr.middleware.eiq_KissFFT
        - scr.middleware.eiq_ruy
        - scr.middleware.eiq_tensorflow_lite_micro_cmsis_nn
        - scr.middleware.eiq_tensorflow_lite_micro_xtensa_nn
        - scr.middleware.Glow_Utils
        - scr.middleware.DeepviewRT_Library
        - scr.middleware.DeepviewRT_Sample
        - scr.middleware.mpp
    component_taxonomy:
      eiq:
        cclass: Machine Learning
        cgroup: eIQ
  dependency:
    anyOf:
    - set.CMSIS_DSP_Lib
    - board:
      - evkbimxrt1050
    - board:
      - evkmimxrt1060
    - board:
      - evkbmimxrt1060
    - board:
      - evkmimxrt1064
    - board:
      - evkmimxrt1170
    - board:
      - evkmimxrt1160
    - board:
      - evkmimxrt595
    - board:
      - evkmimxrt685
    - board:
      - mimxrt685audevk
